DROP TABLE IF EXISTS `students`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `students` (
  `Stud_id` int NOT NULL,
  `Stud_Name` varchar(100) DEFAULT NULL,
  `Stud_Course_ID` varchar(10) DEFAULT NULL,
  `Stud_Join_dt` date DEFAULT NULL,
  `Stud_Email_ID` varchar(255) DEFAULT NULL,
  `stud_contact_no` bigint DEFAULT NULL,
  `Stud_Address` varchar(255) DEFAULT NULL,
  `Stud_Branch_ID` int DEFAULT NULL,
  `Stud_Ed_qualification` varchar(100) DEFAULT NULL,
  `Stud_Gender` enum('Male','Female') DEFAULT NULL,
  `Marks` int DEFAULT NULL,
  PRIMARY KEY (`Stud_id`),
  UNIQUE KEY `uc_stud_unique` (`Stud_Name`,`Stud_Email_ID`,`stud_contact_no`),
  KEY `fk_stud_course` (`Stud_Course_ID`),
  KEY `fk_stud_branch` (`Stud_Branch_ID`),
  CONSTRAINT `fk_stud_branch` FOREIGN KEY (`Stud_Branch_ID`) REFERENCES `branches` (`Branch_id`),
  CONSTRAINT `fk_stud_course` FOREIGN KEY (`Stud_Course_ID`) REFERENCES `courses` (`course_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
